import numpy as np
import matplotlib.pyplot as plt
from scipy.integrate import solve_ivp
import seaborn as sns

#Definimos el mÃ©todo y la funciÃ³n de la derivada que se utilizarÃ¡. AdemÃ¡s se define la funciÃ³n exacta.
def MetodoRK5(function, x_inicial, x_final, y_inicial, step = 0.001):
  """Metodo Runge-Kutta de orden 5
  Recibe como parametros una funciÃ³n, los valores iniciales
  y finales de 'x', el valor inicial de 'y' y el valor de h.
  """

  x = np.arange(x_inicial, x_final+step, step)
  y = np.zeros_like(x)
  y[0] = y_inicial

  for i, elem in enumerate(x):
    k1 = function(x[i], y[i])
    k2 = function(x[i] + 0.25*step, y[i] + 0.25*k1*step)
    k3 = function(x[i] + 0.25*step, y[i] + 0.125*k1*step + 0.125*k2*step)
    k4 = function(x[i] + 0.5*step, y[i] - 0.5*k2*step + k3*step)
    k5 = function(x[i] + 0.75*step, y[i] + (3/16)*k1*step + (9/16)*k4*step)
    k6 = function(x[i] + step, y[i] - (3/7)*k1*step + (2/7)*k2*step + (12/7)*k3*step - (12/7)*k4*step + (8/7)*k5*step)
    if i<x.size-1:
      y[i+1] = y[i] + (1/90)*(7*k1 + 32*k3 + 12*k4 + 32*k5 + 7*k6)*step

  return x, y

def f(x, y):
  return x-2*y

def y_exact(x):
  return (1/4)*(2*x + 5*np.exp(-2*x) - 1)

#Valor del paso h y condiciones iniciales
h = 0.01
x_0 = 0.0
x_f = 5.0
y_0 = 1

#AplicaciÃ³n del mÃ©todo
x, y = MetodoRK5(f, x_0, x_f, y_0, h)

#GrÃ¡fica
plt.plot(x, y_exact(x), label = 'SoluciÃ³n exacta', linestyle = '--')
plt.plot(x, y, label = 'SoluciÃ³n utilizando RK5', linestyle = '-.')
plt.title(r'GrÃ¡fica de $\frac{1}{4}(2x + 5e^{-2x} - 1)$')
plt.xlabel('Eje X')
plt.ylabel('Eje Y')
plt.legend()
plt.show()

"""![Captura de Pantalla 2023-10-16 a la(s) 10.10.20 p.Â m..png](data:image/png;base64,)

Observamos que se trata de una ecuaciÃ³n diferencial de segundo orden. Utilizando una variable auxiliar $v = \frac{dr}{dt}$, podemos convertir el problema en uno de dos ecuaciones diferenciales de primer orden acopladas de la siguiente forma:

$$\frac{dr}{dt} = v = f(t, r, v)$$
$$\frac{dv}{dt} = r\left[\frac{\pi^2}{12}\right]^2sin^2(\pi t) - gsin\left[\frac{\pi}{12} cos(\pi t) \right] = g(t, r, v)$$

Ahora podemos utilizar el mÃ©todo RK5, de la siguiente forma:
"""

#Definimos todas las funciones y el mÃ©todo que se utilizarÃ¡.
def MetodoRK5Coupling(function_x, function_y, t_inicial, t_final, x_inicial, y_inicial, step = 0.001):
  """Metodo Runge-Kutta de orden 6
  Recibe como parametros dos funciones, los valores iniciales
  y finales de 't', los valores iniciales de 'x' y 'y' y el valor de h.

  function_x: funciÃ³n asociada a la derivada de la variable x
  function_y: funciÃ³n asociada a la derivada de la variable y

  """

  t = np.arange(t_inicial, t_final+step, step)
  x = np.zeros_like(t)
  y = np.zeros_like(t)
  x[0] = x_inicial
  y[0] = y_inicial

  for i in range(t.size):
    k1x = function_x(t[i], x[i], y[i])
    k1y = function_y(t[i], x[i], y[i])

    k2x = function_x(t[i] + 0.25*step, x[i] + 0.25*k1x*step, y[i] + 0.25*k1y*step)
    k2y = function_y(t[i] + 0.25*step, x[i] + 0.25*k1x*step, y[i] + 0.25*k1y*step)

    k3x = function_x(t[i] + 0.25*step, x[i] + 0.125*k1x*step + 0.125*k2x*step, y[i] + 0.125*k1y*step + 0.125*k2y*step)
    k3y = function_y(t[i] + 0.25*step, x[i] + 0.125*k1x*step + 0.125*k2x*step, y[i] + 0.125*k1y*step + 0.125*k2y*step)

    k4x = function_x(t[i] + 0.5*step, x[i] - 0.5*k2x*step + k3x*step, y[i] - 0.5*k2y*step + k3y*step)
    k4y = function_y(t[i] + 0.5*step, x[i] - 0.5*k2x*step + k3x*step, y[i] - 0.5*k2y*step + k3y*step)

    k5x = function_x(t[i] + 0.75*step, x[i] + (3/16)*k1x*step + (9/16)*k4x*step, y[i] + (3/16)*k1y*step + (9/16)*k4y*step)
    k5y = function_y(t[i] + 0.75*step, x[i] + (3/16)*k1x*step + (9/16)*k4x*step, y[i] + (3/16)*k1y*step + (9/16)*k4y*step)

    k6x = function_x(t[i] + step, x[i] - (3/7)*k1x*step + (2/7)*k2x*step + (12/7)*k3x*step - (12/7)*k4x*step + (8/7)*k5x*step, y[i] - (3/7)*k1y*step + (2/7)*k2y*step + (12/7)*k3y*step - (12/7)*k4y*step + (8/7)*k5y*step)
    k6y = function_y(t[i] + step, x[i] - (3/7)*k1x*step + (2/7)*k2x*step + (12/7)*k3x*step - (12/7)*k4x*step + (8/7)*k5x*step, y[i] - (3/7)*k1y*step + (2/7)*k2y*step + (12/7)*k3y*step - (12/7)*k4y*step + (8/7)*k5y*step)

    #Se utiliza if para no contar valores mayores al tamaÃ±o de la variable independiente (en este caso, t)
    if i<t.size-1:
      x[i+1] = x[i] + (1/90)*(7*k1x + 32*k3x + 12*k4x + 32*k5x + 7*k6x)*step
      y[i+1] = y[i] + (1/90)*(7*k1y + 32*k3y + 12*k4y + 32*k5y + 7*k6y)*step

  return t, x, y

def f(t, r, v):
  return v

def g(t, r, v):
  g = 9.80665
  return r*(np.power((np.power(np.pi, 2))/12, 2)*np.power(np.sin(np.pi*t), 2)) - g*np.sin((np.pi/12)*np.cos(np.pi*t))

def deriv(t,z): #Se define un arreglo de funciones para utilizarlo en solve_ivp y de esta forma confirmar que el algoritmo desarrollado es correcto.
  r,v = z
  return np.array([f(t,r,v), g(t,r,v)])

#Definimos el paso y valores iniciales
h = 0.001
t_0 = 0
t_f = 5
r_0 = 0.45
v_0 = 0.01

#Usamos el mÃ©todo de RK5
t, r, v = MetodoRK5Coupling(f, g, t_0, t_f, r_0, v_0, h)

#Utilizamos el mÃ©todo de scipy solve_ivp
sol = solve_ivp(deriv, t_span=[t_0, t_f], y0 = [r_0, v_0], t_eval=t)
t2 = sol.t
r2 = sol.y[0]
v2 = sol.y[1]


#Graficas
sns.set_style("whitegrid")
fig = plt.figure(figsize=(10, 5))

plt.subplot(1, 2, 1)
plt.plot(t, r, label=r'PosiciÃ³n $r(t)$ - RK5', linestyle = '--')
plt.plot(t2, r2, label=r'PosiciÃ³n $r(t)$ - Scipy', linestyle = '-.')
plt.xlabel(r'Tiempo $[s]$')
plt.ylabel(r'PosiciÃ³n $r(t)$ $[m]$')
plt.title('GrÃ¡fica de posiciÃ³n vs tiempo')
plt.legend()

plt.subplot(1, 2, 2)
plt.plot(t, v, label=r'Velocidad $v(t)$ - RK5', linestyle = '--')
plt.plot(t2, v2, label=r'Velocidad $v(t)$ - Scipy', linestyle = '-.')
plt.xlabel(r'Tiempo $[s]$')
plt.ylabel(r'Velocidad $v(t)$ $[\frac{m}{s}]$')
plt.title('GrÃ¡fica de velocidad vs tiempo')
plt.legend()

plt.tight_layout()
plt.show()

"""Observamos que la variable r toma valores negativos cerca a $t = 1$. Esto ocurre porque en el problema no consideramos situaciones en las que la masa alcanza la base del dispositivo. Cuando la masa alcanza la base del dispositivo y la golpea, hay fuerzas de contacto involucradas. Estas fuerzas deberian ser modeladas para tener una mejor soluciÃ³n. Tampoco indicamos que el dominio de la coordenada r es (0, $\infty$)."""